import React from "react";
import Question from "./Question";
import "../css/Test.css";

function Test() {
  return (
    <div className="test">
      <div className="test-header">Header</div>
      <div className="test-question">Question</div>
      <div className="test-options">Option</div>
      <div className="test-navigator">Navigator</div>
    </div>
  );
}

export default Test;
